import {Button, Image} from "react-bootstrap";
import "../css/header.css";
import $ from 'jquery';
import Menu from '';

function Header() {
    function openFilter() {
        let filter = $('#filter');
        let value = filter.css('display') === 'none' ? 'block' : 'none';

        filter.css('display', value);
    }

    return (
        <div className="header">
            <Image src={`${process.env.PUBLIC_URL}/menu.svg`}/>
            <Button onClick={openFilter}>filter</Button>
        </div>
    )
}

export default Header;
